ar mni = fni.value;\nmni = mni * m;\nvar T = T.value;\nvar v = vej.value;\nv = v * Math.pow (10,5);\nvar k = k.value;\nvar td = Math.sqrt(2. * k * m / (beta * c * v)) / 86400;\nvar data = source.data;\nvar xstop = 0.0;\nx = data['x']\ny = data['y']\nconsole.log(x);\nconsole.log(y);\nvar distance = distance.value * 3e24;\nvar redshift = redshift.value;\nfor (j = 0; j &lt; x.length; j++) {\n    xstop = j * dx;\n    int1 = numerically_integrate(0,xstop,dx,f1,td);\n    int2 = numerically_integrate(0,xstop,dx,f2,td);\n    factor = 2 * mni / td * Math.exp(-Math.pow(xstop/td,2));\n    L = factor * ((epni-epco) * int1 + epco * int2) / (4.*3.14*Math.pow(distance,2));\n    y[j] = -2.5 * Math.log10(L*wav/c)-48.3;\n    console.log(y[j]);\n    x[j] = dx * j + T;\n}\nsource.change.emit();\n"},"id":"e8bb1e15-43c3-4465-9cf0-f872933398cb","type":"CustomJS"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":5},"x":{"value":58084.309},"y":{"value":21.276404652898552}},"id":"d04ba40d-d349-4d0d-bbd3-0440aa17507f","type":"Circle"},{"attributes":{"fill_alpha":{"value":0.5},"fill_color":{"value":"orange"},"line_alpha":{"value":0.5},"line_color":{"value":"orange"},"size":{"units":"screen","value":5},"x":{"value":58143.085},"y":{"value":21.600838086575372}},"id":"31f37cca-22ea-4d9e-ba3b-d05db20d5df7","type":"Circle"},{"attributes":{"data_source":{"id":"f4c87fbd-f195-4592-82c2-a314953bfdb2","type":"ColumnDataSource"},"glyph":{"id":"5738d24b-b98d-4946-a9fe-2ab71c0bbda6","type":"Circle"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"d04ba40d-d349-4d0d-bbd3-0440aa17507f","type":"Circle"},"selection_glyph":null,"view":{"id":"820e51e4-0576-4d09-93db-7aefc2da88ab","type":"CDSView"}},"id":"a6cc2b8f-bca7-4f92-ba7e-e5fbd5ce5586","type":"GlyphRenderer"},{"attributes":{"source":{"id":"2bbe0922-4379-47d5-8829-f6dae1649d7b","type":"ColumnDataSource"}},"id":"471b04c6-f54
